import React from 'react';
import css from './Post.module.css'

const Post = () => {
    return (
    <li className={css.item}>
      <img alt="postImg"
        src="https://news.liga.net/images/general/2018/04/29/thumbnail-tw-20180429133241-4145.jpg?v=1530804788" />
    </li>
    )
}

export default Post;
